import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Navbar from '../../components/navbar/NavbarFreelancer';
import styles from './Dashboard.module.css';
import { useNavigate } from 'react-router-dom';

const DashboardFreelancer = () => {
 
  useEffect(() => {
    const fetchAcceptedJobs = async () => {
      try {
        const response = await axios.get('http://localhost:8001/jobs/accepted', {
          withCredentials: true,
        });
  
        const { success, data, message } = response.data;
  
        if (success) {
          setJobs(data);
        } else {
          setError(message);
        }
      } catch (error) {
        console.error('Error fetching accepted jobs:', error);
        setError('An error occurred while fetching accepted jobs.');
      }
    };
  
    fetchAcceptedJobs();
  }, []);


  return (
    <>
    <Navbar />
    <div className={styles.ongoingjobs}>
        <h2>My Ongoing Jobs</h2>
    </div>
    </>
    
  );
};

export default DashboardFreelancer;
